						["custom"] = "function(allstates, event, ...)\n    if event == \"OPTIONS\" then\n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = 4,\n            expirationTime = GetTime() + 4,\n            autoHide = false\n        }\n    elseif event == \"LIQUID_ASSIGNMENT_EVENT\" and ... then\n        local id, GUID, duration = ...\n        \n        if id ~= aura_env.id then return end\n        \n        -- Check if the Volatile Infuser is still alive, and find its unit ID (could have changed since timer started)\n        local unit\n        \n        for i = 1, 8 do\n            local bossUnit = \"boss\" .. i\n            \n            if UnitExists(bossUnit) and UnitGUID(bossUnit) == GUID then\n                unit = bossUnit\n                break\n            end\n        end\n        \n        if unit then\n            -- Only create the state if we are within 40 yards of the Volatile Infuser\n            if WeakAuras.CheckRange(unit, 40, \"<=\") then\n                allstates[GUID] = {\n                    show = true,\n                    changed = true,\n                    progressType = \"timed\",\n                    duration = duration,\n                    expirationTime = GetTime() + duration,\n                    autoHide = true\n                }\n            end\n            \n            C_Timer.After(duration + 4, function() WeakAuras.ScanEvents(\"LIQUID_ASSIGNMENT_EVENT\", id, GUID, 4) end)\n            \n            return true\n        end\n    elseif event == \"UNIT_SPELLCAST_SUCCEEDED\" and ... then\n        local unit, _, spellID = ...\n        \n        if spellID == 398331 or spellID == 381688 then -- Unstable Gusts\n            local id = aura_env.id\n            local GUID = UnitGUID(unit)\n            \n            WeakAuras.ScanEvents(\"LIQUID_ASSIGNMENT_EVENT\", id, GUID, 2)\n        end\n    end\nend",
