						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates, event, ...)\n    if event == \"OPTIONS\" then\n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = 20,\n            expirationTime = GetTime() + 20,\n            text = \"New adds on \" .. ICON_LIST[3] .. \"0|t\",\n            autoHide = true\n        }\n    elseif event == \"LIQUID_ASSIGNMENT_EVENT\" and ... then\n        local id, duration, mark = ...\n        \n        if id ~= aura_env.id then return end\n        \n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = duration,\n            expirationTime = GetTime() + duration,\n            text = mark and \"New adds on \" .. ICON_LIST[mark] .. \"0|t\" or \"Final adds spawning\",\n            autoHide = true\n        }\n        \n        return true\n    elseif event == \"ENCOUNTER_START\" and ... then\n        local _, _, difficultyID = ...\n        local spawns = aura_env.spawns[difficultyID]\n        \n        if aura_env.timers then\n            for _, timer in pairs(aura_env.timers) do\n                timer:Cancel()\n            end\n        end\n        \n        aura_env.timers = {}\n        local start = 0\n        local id = aura_env.id\n        \n        for i, spawn in ipairs(spawns) do\n            local duration = spawn.time - start\n            local mark = spawn.mark\n            \n            if start > 0 then\n                table.insert(\n                    aura_env.timers,\n                    C_Timer.NewTimer(\n                        start,\n                        function()\n                            WeakAuras.ScanEvents(\"LIQUID_ASSIGNMENT_EVENT\", id, duration, mark)\n                        end\n                    )\n                )\n            else\n                WeakAuras.ScanEvents(\"LIQUID_ASSIGNMENT_EVENT\", id, duration, mark)\n            end\n            \n            start = spawn.time\n        end\n    end\nend",
