			["url"] = "https://wago.io/LiquidVault/5",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "aura_env.classPriority = {\n    DEATHKNIGHT = 1,\n    EVOKER = 2,\n    ROGUE = 3,\n    PALADIN = 4,\n    PRIEST = 5,\n    SHAMAN = 6,\n    HUNTER = 7,\n    DRUID = 8,\n    DEMONHUNTER = 9,\n    MONK = 10,\n    WARLOCK = 11,\n    WARRIOR = 12,\n    MAGE = 13\n}\n\naura_env.heroicAssignments = {\n    [1] = \"Back\",\n    [2] = \"Front Left\",\n    [3] = \"Front Right\"\n}\n\naura_env.mythicAssignments = {\n    [1] = \"Front Left\",\n    [2] = \"Back\",\n    [3] = \"Front Right\"\n}",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["event"] = "Health",
						["unit"] = "player",
						["names"] = {
						},
						["events"] = "CLEU:SPELL_AURA_APPLIED, ENCOUNTER_START, LIQUID_ASSIGNMENT_EVENT",
						["spellIds"] = {
						},
						["subeventPrefix"] = "SPELL",
						["check"] = "event",
						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates, event, ...)\n    if event == \"OPTIONS\" then\n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = 8,\n            duration = GetTime() + 8,\n            assignment = aura_env.heroicAssignments[3],\n            autoHide = true\n        }\n    elseif event == \"LIQUID_ASSIGNMENT_EVENT\" and ... then\n        local id = ...\n        \n        if id ~= aura_env.id then return end\n        \n        local _, _, difficultyID = GetInstanceInfo()\n        \n        if difficultyID == 15 then -- Heroic, sort based on class mobility\n            table.sort(aura_env.affected,\n                function(GUID1, GUID2)\n                    local unit1 = aura_env.GUIDToUnit[GUID1]\n                    local unit2 = aura_env.GUIDToUnit[GUID2]\n                    \n                    local role1 = UnitGroupRolesAssigned(unit1)\n                    local role2 = UnitGroupRolesAssigned(unit2)\n                    \n                    local class1 = UnitClassBase(unit1)\n                    local class2 = UnitClassBase(unit2)\n                    \n                    local classPrio1 = aura_env.classPriority[class1]\n                    local classPrio2 = aura_env.classPriority[class2]\n                    \n                    if role1 ~= role2 then\n                        return role1 > role2\n                    elseif classPrio1 ~= classPrio2 then\n                        return classPrio1 < classPrio2\n                    else\n                        return GUID1 < GUID2\n                    end\n                end\n            )\n        else -- Mythic, sort based on MRT note/ranged type\n            local GUID1 = aura_env.affected[1]\n            local GUID2 = aura_env.affected[2]\n            local GUID3 = aura_env.affected[3]\n            \n            local unit1 = aura_env.GUIDToUnit[GUID1]\n            local unit2 = aura_env.GUIDToUnit[GUID2]\n            local unit3 = aura_env.GUIDToUnit[GUID3]\n            \n            local type1 = LiquidWeakAuras:Spec(unit1)\n            local type2 = LiquidWeakAuras:Spec(unit2)\n            local type3 = LiquidWeakAuras:Spec(unit3)\n            \n            local meleeCount = 0\n            meleeCount = meleeCount + (type1 == \"m\" and 1 or 0)\n            meleeCount = meleeCount + (type2 == \"m\" and 1 or 0)\n            meleeCount = meleeCount + (type3 == \"m\" and 1 or 0)\n            \n            if meleeCount == 2 then -- Ranged always back, sort melee based on note\n                local melee1, melee2, ranged1\n                \n                if type1 == \"m\" then\n                    melee1 = GUID1\n                    melee2 = type2 == \"m\" and GUID2 or GUID3\n                    ranged1 = type2 == \"r\" and GUID2 or GUID3\n                else\n                    ranged1 = GUID1\n                    melee1 = GUID2\n                    melee2 = GUID3\n                end\n                \n                local meleePlayers = {melee1, melee2}\n                \n                table.sort(meleePlayers,\n                    function(guid1, guid2)\n                        local prio1 = aura_env.GUIDPriority[guid1] or 10\n                        local prio2 = aura_env.GUIDPriority[guid2] or 10\n                        \n                        if prio1 ~= prio2 then\n                            return prio1 < prio2\n                        else\n                            return guid1 < guid2\n                        end\n                    end\n                )\n                \n                aura_env.affected = {meleePlayers[1], ranged1, meleePlayers[2]}\n            elseif meleeCount == 1 then\n                -- First check which ranged has prio closest to center, assign them back\n                local ranged1, ranged2, melee1\n                \n                if type1 == \"r\" then\n                    ranged1 = GUID1\n                    ranged2 = type2 == \"r\" and GUID2 or GUID3\n                    melee1 = type2 == \"m\" and GUID2 or GUID3\n                else\n                    melee1 = GUID1\n                    ranged1 = GUID2\n                    ranged2 = GUID3\n                end\n                \n                -- Figure out which ranged should be assigned back, based on who is more centered on the note\n                local ranged1MiddlePrio = math.abs((aura_env.GUIDPriority[ranged1] or 10) - 10)\n                local ranged2MiddlePrio = math.abs((aura_env.GUIDPriority[ranged2] or 10) - 10)\n                \n                local frontPlayers\n                local backPlayer\n                if ranged1MiddlePrio < ranged2MiddlePrio then\n                    frontPlayers = {ranged2, melee1}\n                    backPlayer = ranged1\n                else\n                    frontPlayers = {ranged1, melee1}\n                    backPlayer = ranged2\n                end\n                \n                -- Sort the two front players based on note\n                table.sort(frontPlayers,\n                    function(guid1, guid2)\n                        local prio1 = aura_env.GUIDPriority[guid1] or 10\n                        local prio2 = aura_env.GUIDPriority[guid2] or 10\n                        \n                        if prio1 ~= prio2 then\n                            return prio1 < prio2\n                        else\n                            return guid1 < guid2\n                        end\n                    end\n                )\n                \n                aura_env.affected = {frontPlayers[1], backPlayer, frontPlayers[2]}\n            else -- Three ranged players, just sort based on note\n                table.sort(aura_env.affected,\n                    function(guid1, guid2)\n                        local prio1 = aura_env.GUIDPriority[guid1] or 10\n                        local prio2 = aura_env.GUIDPriority[guid2] or 10\n                        \n                        if prio1 ~= prio2 then\n                            return prio1 < prio2\n                        else\n                            return guid1 < guid2\n                        end\n                    end\n                )\n            end\n        end\n        \n        local assignments = difficultyID == 15 and aura_env.heroicAssignments or aura_env.mythicAssignments\n        \n        for i, GUID in ipairs(aura_env.affected) do\n            if GUID == WeakAuras.myGUID then\n                local auraInfo = C_UnitAuras.GetPlayerAuraBySpellID(381615)\n                \n                allstates[\"\"] = {\n                    show = true,\n                    changed = true,\n                    progressType = \"timed\",\n                    duration = auraInfo and auraInfo.duration or 8,\n                    expirationTime = auraInfo and auraInfo.expirationTime or (GetTime() + 8),\n                    assignment = assignments[i],\n                    autoHide = true\n                }\n                \n                WeakAuras.ScanEvents(\"LIQUID_RASZAGETH_STATIC_CHARGE\", assignments[i])\n            end\n        end\n        \n        aura_env.affected = {}\n        \n        return true\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, subEvent, _, _, _, _, _, destGUID, _, _, _, spellID = ...\n        \n        if subEvent == \"SPELL_AURA_APPLIED\" and spellID == 381615 then\n            table.insert(aura_env.affected, destGUID)\n            \n            if #aura_env.affected == 1 then\n                local id = aura_env.id\n                C_Timer.After(0.2, function() WeakAuras.ScanEvents(\"LIQUID_ASSIGNMENT_EVENT\", id) end)\n            end\n        end\n    elseif event == \"ENCOUNTER_START\" and ... then\n        aura_env.affected = {}\n        aura_env.GUIDToUnit = {}\n        aura_env.GUIDPriority = {}\n        \n        for unit in WA_IterateGroupMembers() do\n            aura_env.GUIDToUnit[UnitGUID(unit)] = unit\n        end\n        \n        if (IsAddOnLoaded(\"ExRT\") or IsAddOnLoaded(\"MRT\")) and _G.VExRT.Note.Text1 then\n            local betweenLine = false\n            local lineCount = 0\n            \n            for line in _G.VExRT.Note.Text1:gmatch(\"[^\\r\\n]+\") do\n                if line == \"liquidEnd\" then\n                    betweenLine = false\n                end\n                \n                if betweenLine then\n                    lineCount = lineCount + 1\n                    \n                    for unit in WA_IterateGroupMembers() do\n                        local name = UnitName(unit)\n                        local nickname = LiquidAPI and LiquidAPI:GetName(unit) or name\n                        \n                        if line:match(name) or line:match(nickname) then\n                            local GUID = UnitGUID(unit)\n                            \n                            aura_env.GUIDPriority[GUID] = lineCount\n                        end\n                    end\n                end\n                \n                if line == \"liquidStart\" then\n                    betweenLine = true\n                end\n            end\n        end\n    end\nend",
