			["wagoID"] = "PhyUARO8V",
			["authorOptions"] = {
			},
			["preferToUpdate"] = false,
			["customText"] = "function()\n    if WeakAuras.IsOptionsOpen() then return end\n    \n    local side = aura_env.states and aura_env.states[1] and aura_env.states[1].side\n    local affected = aura_env.states and aura_env.states[2] and aura_env.states[2].show\n    \n    if side and affected then\n        local message = side == \"LEFT\" and \"Left\" or side == \"RIGHT\" and \"Right\"\n        \n        if not aura_env.last or aura_env.last < GetTime() - 1 then\n            aura_env.last = GetTime()\n            \n            if message then\n                SendChatMessage(message)\n            end\n        end\n    end\nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/LiquidVault/5",
			["actions"] = {
				["start"] = {
					["message"] = "",
					["do_loop"] = false,
					["do_message"] = false,
					["do_sound"] = false,
				},
				["init"] = {
					["custom"] = "aura_env.classTankiness = {\n    WARLOCK = 1,\n    ROGUE = 2,\n    DRUID = 3,\n    MONK = 4,\n    DEMONHUNTER = 5,\n    DEATHKNIGHT = 6,\n    PALADIN = 7,\n    EVOKER = 8,\n    HUNTER = 9,\n    SHAMAN = 10,\n    WARRIOR = 11,\n    MAGE = 12,\n    PRIEST = 13,\n}",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_type"] = "stateupdate",
						["customVariables"] = "{\n    side = {\n        display = \"Side\",\n        type = \"select\",\n        values = {\n            LEFT = \"Left\",\n            RIGHT = \"Right\",\n            NONE = \"Do not soak\"\n        }\n    }\n}",
						["event"] = "Health",
						["unit"] = "player",
						["subeventSuffix"] = "_CAST_START",
						["subeventPrefix"] = "SPELL",
						["events"] = "ENCOUNTER_START, UNIT_SPELLCAST_START:boss, CLEU:SPELL_AURA_APPLIED, LIQUID_ASSIGNMENT_EVENT",
						["names"] = {
						},
						["check"] = "event",
						["spellIds"] = {
						},
						["custom"] = "function(allstates, event, ...)\n    if event == \"OPTIONS\" then\n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = 5,\n            expirationTime = GetTime() + 5,\n            side = \"LEFT\",\n            autoHide = true\n        }\n    elseif event == \"LIQUID_ASSIGNMENT_EVENT\" and ... then\n        local id = ...\n        \n        if id ~= aura_env.id then return end\n        if not aura_env.assignments[4] then return end\n        if not #aura_env.affected == 2 then return end\n        \n        -- The only time we ever use the assignments on lines 1 and 2 is for the first add cast\n        -- In all other scenarios we use the assignments on lines 3 and 4\n        local leftAssignments = aura_env.assignments[3]\n        local rightAssignments = aura_env.assignments[4]\n        \n        if aura_env.caster == \"ADD\" and aura_env.count == 1 then\n            leftAssignments = aura_env.assignments[1]\n            rightAssignments = aura_env.assignments[2]\n        end\n        \n        local myAssignment = tContains(leftAssignments, WeakAuras.myGUID) and \"LEFT\" or tContains(rightAssignments, WeakAuras.myGUID) and \"RIGHT\"\n        local side -- Side that we are assigned for the current Absolute Zero\n        \n        -- If we are affected by Frost Bite, do not soak\n        -- If we are affected by Absolute Zero, prefer to go to the side we were assigned\n        -- If both affected players are assigned the same side, prioritize based on order they are listed on the note\n        -- If neither player is assigned on the note, assign based on application order\n        if C_UnitAuras.GetPlayerAuraBySpellID(372514) then -- Frost Bite\n            side = \"NONE\"\n        elseif aura_env.affected[1] == WeakAuras.myGUID or aura_env.affected[2] == WeakAuras.myGUID then\n            local otherGUID = aura_env.affected[1] == WeakAuras.myGUID and aura_env.affected[2] or aura_env.affected[1] -- GUID of the other affected person\n            local otherAssignment = tContains(leftAssignments, otherGUID) and \"LEFT\" or tContains(rightAssignments, otherGUID) and \"RIGHT\"\n            \n            if myAssignment and otherAssignment then -- We are both assigned by the note\n                if myAssignment == otherAssignment then -- We are both assigned to same side on the note\n                    local myPrio = myAssignment == \"LEFT\" and tIndexOf(leftAssignments, WeakAuras.myGUID) or tIndexOf(rightAssignments, WeakAuras.myGUID)\n                    local otherPrio = otherAssignment == \"LEFT\" and tIndexOf(leftAssignments, otherGUID) or tIndexOf(rightAssignments, otherGUID)\n                    \n                    if myPrio < otherPrio then\n                        side = myAssignment == \"LEFT\" and \"LEFT\" or \"RIGHT\" -- If our priority is higher, we get our preferred side\n                    else\n                        side = myAssignment == \"LEFT\" and \"RIGHT\" or \"LEFT\" -- If our priority is lower, the other player gets their preferred side\n                    end\n                else -- We are assigned to different sides on the note\n                    side = myAssignment\n                end\n            elseif myAssignment and not otherAssignment then -- Only we are assigned by the note\n                side = myAssignment\n            elseif otherAssignment and not myAssignment then -- Only the other player is assigned by the note\n                side = otherAssignment == \"LEFT\" and \"RIGHT\" or \"LEFT\"\n            else -- Neither of us are assigned by the note, assign most tanky class left\n                table.sort(aura_env.affected,\n                    function(GUID1, GUID2)\n                        local unit1 = aura_env.GUIDToUnit[GUID1]\n                        local unit2 = aura_env.GUIDToUnit[GUID2]\n                        \n                        local class1 = UnitClassBase(unit1)\n                        local class2 = UnitClassBase(unit2)\n                        \n                        local prio1 = aura_env.classTankiness[class1]\n                        local prio2 = aura_env.classTankiness[class2]\n                        \n                        if prio1 ~= prio2 then\n                            return prio1 < prio2\n                        else\n                            return GUID1 < GUID2\n                        end\n                    end\n                )\n                \n                side = aura_env.affected[1] == WeakAuras.myGUID and \"LEFT\" or \"RIGHT\"\n            end\n        else -- We are not affected\n            side = myAssignment or \"NONE\"\n        end\n        \n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = 5,\n            expirationTime = GetTime() + 5,\n            side = side,\n            autoHide = true\n        }\n        \n        aura_env.affected = {}\n        \n        return true\n    elseif event == \"UNIT_SPELLCAST_START\" and ... then\n        local unit, _, spellID = ...\n        \n        if spellID == 372456 then -- Absolute Zero\n            if unit == \"boss1\" then -- Kurog Grimtotem\n                aura_env.caster = \"BOSS\"\n            else -- Frozen Destroyer\n                aura_env.caster = \"ADD\"\n                aura_env.count = aura_env.count + 1\n            end\n        end\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, subEvent, _, _, _, _, _, destGUID, _, _, _, spellID = ...\n        \n        if subEvent == \"SPELL_AURA_APPLIED\" and spellID == 372458 then -- Absolute Zero\n            table.insert(aura_env.affected, destGUID)\n            \n            if #aura_env.affected == 1 then\n                local id = aura_env.id\n                C_Timer.After(0.2, function() WeakAuras.ScanEvents(\"LIQUID_ASSIGNMENT_EVENT\", id) end)\n            end\n        end\n    elseif event == \"ENCOUNTER_START\" and ... then\n        aura_env.count = 0 -- Number of Absolute Zero casts BY THE ADD\n        aura_env.affected = {}\n        aura_env.assignments = {}\n        aura_env.GUIDToUnit = {}\n        \n        for unit in WA_IterateGroupMembers() do\n            aura_env.GUIDToUnit[UnitGUID(unit)] = unit\n        end\n        \n        if (IsAddOnLoaded(\"ExRT\") or IsAddOnLoaded(\"MRT\")) and _G.VExRT.Note.Text1 then\n            local lineCount = 0\n            local betweenLine = false\n            \n            for line in _G.VExRT.Note.Text1:gmatch(\"[^\\r\\n]+\") do\n                local trimmedLine = strtrim(line):lower()\n                \n                if trimmedLine == \"liquidend\" then\n                    betweenLine = false\n                end\n                \n                if betweenLine then\n                    lineCount = lineCount + 1\n                    local assignments = {}\n                    \n                    for word in line:gmatch(\"%S+\") do\n                        for unit in WA_IterateGroupMembers() do\n                            local name = UnitName(unit)\n                            local nickname = LiquidAPI and LiquidAPI:GetName(unit) or name\n                            \n                            if word:match(name) or word:match(nickname) then\n                                local GUID = UnitGUID(unit)\n                                table.insert(assignments, GUID)\n                                break\n                            end\n                        end\n                    end\n                    \n                    table.insert(aura_env.assignments, assignments)\n                end\n                \n                if trimmedLine == \"liquidstart\" then\n                    betweenLine = true\n                end\n            end\n        end\n    end\nend",
