						["custom_type"] = "status",
						["custom"] = "function(event, ...)\n    if event == \"ENCOUNTER_START\" and ... then\n        aura_env.storedUnits = {}\n        \n        C_ChatInfo.SendAddonMessage(\"LiquidWA_Spec\", GetSpecializationInfo(GetSpecialization()), IsInGroup(LE_PARTY_CATEGORY_INSTANCE) and \"INSTANCE_CHAT\" or IsInRaid() and \"RAID\" or \"PARTY\")\n    elseif event == \"GROUP_ROSTER_UPDATE\" then\n        aura_env.GUIDToUnit = {}\n        \n        for unit in WA_IterateGroupMembers() do\n            aura_env.GUIDToUnit[UnitGUID(unit)] = unit\n        end\n    elseif event == \"LIQUIDWA_MSG_INTERNAL\" and ... then\n        local prefix, text, _, sender = ...\n        \n        if prefix == \"LiquidWA_Spec\" and tonumber(text) then -- Someone broadcast their spec ID\n            local unit = Ambiguate(sender, \"short\")\n            \n            if UnitExists(unit) then\n                aura_env.storedUnits[UnitGUID(unit)] = tonumber(text)\n            end\n        end\n    elseif event == \"UNIT_SPELLCAST_SUCCEEDED\" and ... then -- Watch for casts by Feral Druids/Enhancement Shamans/Survival Hunters unique to their spec\n        local unit, _, spellID = ...\n        local spec = aura_env.meleeSpells[spellID]\n        \n        if spec then\n            aura_env.storedUnits[UnitGUID(unit)] = spec\n        end\n    end\nend",
