		["Fulminating Charge - Players in range"] = {
			["outline"] = "OUTLINE",
			["wagoID"] = "PhyUARO8V",
			["displayText_format_icon_format"] = "none",
			["displayText"] = "Players in range:\n%c",
			["customText"] = "function()\n    if aura_env.state and aura_env.state.players then\n        if #aura_env.state.players > 0 then\n            local playerList = \"\"\n            \n            for i = 1, math.min(aura_env.config.numPlayers, #aura_env.state.players) do\n                playerList = string.format(\"%s(%d) %s|n\", playerList, aura_env.state.players[i].range, WA_ClassColorName(aura_env.state.players[i].unit))\n            end\n            \n            return playerList\n        else\n            return \"None\"\n        end\n    end\nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["displayText_format_p_time_format"] = 0,
			["customTextUpdate"] = "event",
			["automaticWidth"] = "Auto",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
				},
				["finish"] = {
					["custom"] = "local state = aura_env.state\n\n-- If we're doing a dry test, check if anyone was in range when our debuff expired and notify others\nif state.isTest and #state.players > 0 then\n    local GUIDs = \"\"\n    \n    for _, data in ipairs(state.players) do\n        GUIDs = string.format(\"%s:%s\", GUIDs, UnitGUID(data.unit))\n    end\n    \n    LiquidWeakAuras:Broadcast(\"LiquidWA_Test\", \"RaszagethFulminatingCharge:2:1\" .. GUIDs)\nend",
					["do_custom"] = true,
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_type"] = "stateupdate",
						["custom_hide"] = "timed",
						["event"] = "Health",
						["unit"] = "player",
						["subeventSuffix"] = "_CAST_START",
						["subeventPrefix"] = "SPELL",
						["events"] = "LIQUID_RASZAGETH_ASSIGNMENT_RL, FRAME_UPDATE",
						["names"] = {
						},
						["check"] = "event",
						["spellIds"] = {
						},
						["custom"] = "function(allstates, event, ...)\n    if event == \"OPTIONS\" then\n        allstates = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = 5,\n            expirationTime = GetTime() + 5,\n            players = {\"player\", \"player\", \"player\", \"player\", \"player\"},\n            mark = ICON_LIST[math.random(3)] .. \"0|t\",\n            autoHide = true\n        }\n    elseif event == \"FRAME_UPDATE\" then\n        local state = allstates[\"\"]\n        \n        if state then\n            local playersInRange = {}\n            \n            for unit in WA_IterateGroupMembers() do\n                local range = WeakAuras.GetRange(unit) -- We are only interested in minimum range\n                \n                if not UnitIsUnit(unit, \"player\") and not UnitIsDeadOrGhost(unit) and (range <= state.range) then\n                    table.insert(playersInRange, {unit = unit, range = range})\n                end\n            end\n            \n            table.sort(\n                playersInRange,\n                function(a, b)\n                    if a.range ~= b.range then\n                        return a.range < b.range\n                    else\n                        return UnitGUID(a.unit) < UnitGUID(b.unit)\n                    end\n                end\n            )\n            \n            state.players = playersInRange\n            state.changed = true\n            \n            return true\n        end\n    elseif event == \"LIQUID_RASZAGETH_ASSIGNMENT_RL\" and ... then\n        local mark, unit, affected, duration, range, isTest = ...\n        \n        if UnitIsUnit(unit, \"player\") and affected then\n            allstates[\"\"] = {\n                show = true,\n                changed = true,\n                progressType = \"timed\",\n                duration = duration,\n                expirationTime = GetTime() + duration,\n                players = {},\n                range = range,\n                mark = mark and ICON_LIST[mark] .. \"0|t\",\n                isTest = isTest,\n                autoHide = true\n            }\n            \n            return true\n        end\n    end\nend",
