			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "function aura_env.IsMyTurn()\n    if not aura_env.assignments[aura_env.count] then \n        return false\n    end\n    \n    local primary = aura_env.assignments[aura_env.count].primary\n    local backups = aura_env.assignments[aura_env.count].backup\n    \n    -- Count the number of DPS and healers that are dead\n    local deadDPS = 0\n    local deadHealers = 0\n    \n    for _, GUID in ipairs(primary) do\n        local unit = aura_env.GUIDToUnit[GUID]\n        \n        if UnitIsDeadOrGhost(unit) or WA_GetUnitDebuff(unit, 390449) then\n            local role = UnitGroupRolesAssigned(unit)\n            \n            if role == \"DAMAGER\" then\n                deadDPS = deadDPS + 1\n            elseif role == \"HEALER\" then\n                deadHealers = deadHealers + 1\n            end\n        elseif GUID == WeakAuras.myGUID then\n            return true\n        end\n    end\n    \n    local backupDPSAssigned = 0\n    local backupHealersAssigned = 0\n    \n    for _, GUID in ipairs(backups) do\n        local unit = aura_env.GUIDToUnit[GUID]\n        \n        if not (UnitIsDeadOrGhost(unit) or WA_GetUnitDebuff(unit, 390449)) then\n            local role = UnitGroupRolesAssigned(unit)\n            \n            if role == \"DAMAGER\" and backupDPSAssigned < deadDPS then\n                backupDPSAssigned = backupDPSAssigned + 1\n                \n                if GUID == WeakAuras.myGUID then\n                    return true\n                end\n            elseif role == \"HEALER\" and backupHealersAssigned < deadHealers then\n                backupHealersAssigned = backupHealersAssigned + 1\n                \n                if GUID == WeakAuras.myGUID then\n                    return true\n                end\n            end\n        end\n    end\nend",
