						["check"] = "event",
						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates, event, ...)\n    if event == \"LIQUID_ASSIGNMENT_EVENT\" and ... then\n        local id = ...\n        \n        if id ~= aura_env.id then return end\n        \n        aura_env.count = aura_env.count + 1\n        \n        if aura_env.IsMyTurn() then\n            allstates[\"\"] = {\n                show = true,\n                changed = true,\n                autoHide = false\n            }\n            \n            return true\n        else\n            local state = allstates[\"\"]\n            \n            if state then\n                state.show = false\n                state.changed = true    \n            end\n        end\n        \n        return true\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, subEvent, _, _, _, _, _, destGUID, _, _, _, spellID = ...\n        \n        if subEvent == \"SPELL_CAST_SUCCESS\" and spellID == 395501 then -- Blowback\n            local id = aura_env.id\n            \n            C_Timer.After(3, function() WeakAuras.ScanEvents(\"LIQUID_ASSIGNMENT_EVENT\", id) end)\n        elseif subEvent == \"UNIT_DIED\" or subEvent == \"SPELL_AURA_REMOVED\" and (spellID == 160029 or spellID == 225080) then -- Resurrecting/Reincarnation\n            if aura_env.IsMyTurn() then\n                allstates[\"\"] = {\n                    show = true,\n                    changed = true,\n                    autoHide = false\n                }\n                \n                return true\n            else\n                local state = allstates[\"\"]\n                \n                if state then\n                    state.show = false\n                    state.changed = true    \n                end\n            end\n            \n            return true\n        end\n    elseif event == \"ENCOUNTER_START\" and ... then\n        aura_env.count = 1\n        aura_env.assignments = {}\n        aura_env.GUIDToUnit = {}\n        \n        for unit in WA_IterateGroupMembers() do\n            aura_env.GUIDToUnit[UnitGUID(unit)] = unit\n        end\n        \n        if (IsAddOnLoaded(\"ExRT\") or IsAddOnLoaded(\"MRT\")) and _G.VExRT.Note.Text1 then\n            local betweenLine = false\n            local lineCount = 0\n            \n            for line in _G.VExRT.Note.Text1:gmatch(\"[^\\r\\n]+\") do\n                if line == \"liquidEnd\" then\n                    betweenLine = false\n                end\n                \n                if betweenLine then\n                    local order = {primary = {}, backup = {}}\n                    local primary = true\n                    \n                    for word in line:gmatch(\"%S+\") do\n                        if word:find(\"%(\") then\n                            primary = false\n                        end\n                        \n                        for unit in WA_IterateGroupMembers() do\n                            local GUID = UnitGUID(unit)\n                            \n                            local name = UnitName(unit)\n                            local nickname = LiquidAPI and LiquidAPI:GetName(name) or name\n                            \n                            if word:match(name) or word:match(nickname) then\n                                table.insert(primary and order.primary or order.backup, GUID)\n                            end\n                        end\n                    end\n                    \n                    table.insert(aura_env.assignments, order)\n                end\n                \n                if line == \"liquidStart\" then\n                    betweenLine = true\n                end\n            end\n        end\n        \n        if aura_env.IsMyTurn() then\n            allstates[\"\"] = {\n                show = true,\n                changed = true,\n                autoHide = false\n            }\n            \n            return true\n        end\n    end\nend",
