				["init"] = {
					["custom"] = "aura_env.spot = false\naura_env.alreadyWarned = false\naura_env.checkEXRTNote = function()\n    local raidComp = {}\n    aura_env.spot = nil\n    aura_env.alreadyWarned = false\n    for i = 1, GetNumGroupMembers() do\n        local unitID = \"raid\"..i\n        local guid = UnitGUID(unitID)\n        if guid then\n            local name = UnitName(unitID)\n            raidComp[name:lower()] = {g = guid, uid = unitID, rname = name}\n        end\n    end\n    if not VMRT.Note.enabled then\n        print(\"Error: enable exrt note!\")\n        return \n    end\n    if VMRT and VMRT.Note and VMRT.Note.Text1 then\n        local note = VMRT.Note.Text1:lower()\n        --Clean words\n        note = note:gsub(\"||r\", \"\")\n        note = note:gsub(\"||cff%x%x%x%x%x%x\", \"\")\n        local lines = {strsplit(\"\\n\", note)}\n        local shouldCare = false\n        for _,line in ipairs(lines) do\n            if line:lower() == \"liquidstart3\" then\n                shouldCare = true\n            elseif line:lower() == \"liquidend3\" then\n                return -- assume there isn't more than 1 thing to parse from exrt note\n            elseif shouldCare then\n                local side, rota\n                if line:match(\"^red\") then\n                    side = \"RED\"\n                elseif line:match(\"^blue\") then\n                    side = \"BLUE\"\n                else\n                    print(\"Liquid Note (Intermission reminder): Incorrect syntax\")\n                    return\n                end\n                local str = line:gsub(\"red\", \"\")\n                str = str:gsub(\"blue\", \"\")\n                for word in str:gmatch(\"%S+\") do -- cba to do smarter checking\n                    local realChar\n                    local t = LiquidAPI and LiquidAPI:GetCharacters(word:gsub(\"^%l\", string.upper))\n                    if t then\n                        for k,v in pairs(t) do\n                            if raidComp[k:lower()] then\n                                word = k:lower()\n                                break\n                            end\n                        end\n                    end\n                    if not raidComp[word] then\n                        print(string.format(\"Error: member not found in raid (%s)\", word))\n                    else\n                        if UnitIsUnit(raidComp[word].uid, \"player\") then\n                            aura_env.spot = side\n                        end\n                    end\n                end\n            end\n        end\n    end\nend",
