						["custom"] = "function(allstates, event, ...)\n    if event == \"OPTIONS\" then\n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = 5,\n            expirationTime = GetTime() + 5,\n            side = \"LEFT\",\n            autoHide = true\n        }\n    elseif event == \"LIQUID_RASZAGETH_STORMCHARGED_TEST\" then\n        local positive = ...\n        local spellID = positive and 394576 or 394579\n        \n        C_Timer.After(3, function() WeakAuras.ScanEvents(\"LIQUID_TEST_CLEU\", true, \"SPELL_AURA_APPLIED\", nil, nil, nil, nil, nil, WeakAuras.myGUID, nil, nil, nil, spellID) end)\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" or event == \"LIQUID_TEST_CLEU\" then\n        local _, subEvent, _, _, _, _, _, destGUID, _, _, _, spellID = ...\n        \n        if not aura_env.assignment then return end\n        if not aura_env.initialApplication then return end\n        \n        if destGUID == WeakAuras.myGUID and (spellID == 394579 or spellID == 394576) then -- Negative/Positive Charge\n            aura_env.initialApplication = false\n            \n            local side = aura_env.sides[aura_env.assignment][spellID]\n            \n            allstates[\"\"] = {\n                show = true,\n                changed = true,\n                progressType = \"timed\",\n                duration = 5,\n                expirationTime = GetTime() + 5,\n                side = side,\n                autoHide = true\n            }\n            \n            return true\n        end\n    elseif event == \"UNIT_SPELLCAST_START\" and ... then\n        local _, _, spellID = ...\n        \n        if spellID == 387261 then\n            aura_env.initialApplication = true\n        end\n    elseif event == \"ENCOUNTER_START\" and ... then\n        aura_env.assignment = nil\n        \n        if (IsAddOnLoaded(\"ExRT\") or IsAddOnLoaded(\"MRT\")) and _G.VExRT.Note.Text1 then\n            local betweenLine = false\n            local lineCount = 0\n            local playerName = UnitName(\"player\")\n            local playerNickname = LiquidAPI and LiquidAPI:GetName(\"player\") or playerName\n            \n            for line in _G.VExRT.Note.Text1:gmatch(\"[^\\r\\n]+\") do\n                if line == \"liquidEnd2\" then\n                    betweenLine = false\n                end\n                \n                if betweenLine then\n                    lineCount = lineCount + 1\n                    \n                    if line:match(playerName) or line:match(playerNickname) then\n                        aura_env.assignment = lineCount\n                    end\n                end\n                \n                if line == \"liquidStart2\" then\n                    betweenLine = true\n                end\n            end\n        end\n    end\nend",
