						["custom"] = "function(allstates, event, ...)\n    if event == \"OPTIONS\" then\n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            progressType = \"timed\",\n            duration = 4,\n            expirationTime = GetTime() + 4,\n            side = \"|cff4287f5BLUE|r\",\n            autoHide = true\n        }\n    elseif event == \"LIQUID_ASSIGNMENT_EVENT\" and ... then\n        local id = ...\n        \n        if id ~= aura_env.id then return end\n        \n        if aura_env.side and not aura_env.firstBreath then\n            allstates[\"\"] = {\n                show = true,\n                changed = true,\n                progressType = \"timed\",\n                duration = 3.5,\n                expirationTime = GetTime() + 3.5,\n                side = aura_env.side == \"BLUE\" and \"|cfffc1930RED|r\" or \"|cff4287f5BLUE|r\",\n                autoHide = true\n            }\n            \n            return true\n        end\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, subEvent, _, _, _, _, _, _, _, _, _, spellID = ...\n        \n        if subEvent == \"SPELL_CAST_START\" and spellID == 385065 then\n            aura_env.count = aura_env.count + 1\n            \n            if aura_env.count == 1 then\n                local id = aura_env.id\n                \n                C_Timer.After(0.5, function() WeakAuras.ScanEvents(\"LIQUID_ASSIGNMENT_EVENT\", id) end)\n            end\n        end\n    elseif event == \"CHAT_MSG_RAID_BOSS_EMOTE\" and ... then\n        local text = ...\n        \n        if text:match(\"Raszageth takes a deep breath\") and aura_env.count == 1 then\n            aura_env.firstBreath = true\n            \n            allstates[\"\"] = {\n                show = true,\n                changed = true,\n                progressType = \"timed\",\n                duration = 4,\n                expirationTime = GetTime() + 4,\n                side = aura_env.side == \"BLUE\" and \"|cff4287f5BLUE|r\" or \"|cfffc1930RED|r\",\n                autoHide = true\n            }\n            \n            return true\n        end\n    elseif event == \"ENCOUNTER_START\" and ... then\n        aura_env.count = 0\n        aura_env.firstBreath = false\n        aura_env.side = nil\n        \n        local playerName = UnitName(\"player\")\n        local playerNickname = LiquidAPI and LiquidAPI:GetName(\"player\") or playerName\n        \n        if (IsAddOnLoaded(\"ExRT\") or IsAddOnLoaded(\"MRT\")) and _G.VExRT.Note.Text1 then\n            local betweenLine = false\n            \n            for line in _G.VExRT.Note.Text1:gmatch(\"[^\\r\\n]+\") do\n                if line:lower() == \"liquidend3\" then\n                    betweenLine = false\n                end\n                \n                if betweenLine then\n                    if line:match(playerName) or line:match(playerNickname) then\n                        if line:match(\"^red\") then\n                            aura_env.side = \"RED\"\n                        elseif line:match(\"^blue\") then\n                            aura_env.side = \"BLUE\"\n                        end\n                    end\n                end\n                \n                if line:lower() == \"liquidstart3\" then\n                    betweenLine = true\n                end\n            end\n        end\n    end\nend",
